import React from 'react'
import { useHistory } from 'react-router'

const Home = () => {
    const history = useHistory()

    const goTo = () => {
        history.push("/profile")
    }

    return (
        <div>
            <h1>Welcome to home</h1>
            <button onClick={goTo}>profile</button>
        </div>
    )
}

export default Home
